					<div class="pt-half pa3">
						<img src="./img/lima/limalogo.png" alt="img" className=" whale" />
					</div>
				</Slider>
				<div className="black optima ttu f1 fw5 tracked-tight pt2 pl2 pl1-m">
					Loghi
				</div>
			</section>
		);
	}
}
